The recommended way of storing your bot's token is by using environment variables. You should not hard code your bot's token directly into your program. BOT_TOKEN="" Optionally, you can use another third party module to automatically load the environment variables for you. In your main.ts file: const token = `Bot ${Deno.env.get("BOT_TOKEN")}`; You must enable --allow-env to use environment variables. $ BOT_TOKEN="" deno run --allow-env --allow-net main.ts You can also use prompt if you forget to set an environment variable when running your program from the CLI. let token = Deno.env.get("BOT_TOKEN") ?? prompt("bot token:");
if (!token) { throw new Error("Missing token");
}
token = `Bot ${token}`; See the Deno manual for additional details.
